@Override
public boolean equals(Object o) {
  if (!(o instanceof GeoCircle))
    return false;
  GeoCircle other = (GeoCircle) o;
  return super.equals(other) && other.center.equals(center) && other.cutoffAngle == cutoffAngle;
}

